To find the period of the whole thing, we need to find the smallest time that *both* parts repeat.  That's like finding the smallest number that both 2π and 2π/3 go into evenly.  

The smallest such number is 2π.



\begin{equation*}
\boxed{2\pi}
\end{equation*}

Cotangent is like the opposite of tangent.  It's found by dividing cosine by sine.

So,  $\cot 90^\circ = \frac{\cos 90^\circ}{\sin 90^\circ}$.

We know that cosine of 90 degrees is 0, and sine of 90 degrees is 1.

Therefore, $\cot 90^\circ = \frac{0}{1} = 0$.



\begin{equation*}
\cot 90^\circ = \boxed{0}
\end{equation*}

