Okay, so  135 degrees is kinda like a special angle.  It's in the second quadrant, where the y-values are positive and the x-values are negative.

We know that the tangent is like "rise over run" on a graph.  

Since 135 degrees is the same as 45 degrees past 90 degrees,  the rise is the same as the run, but since we're in the second quadrant, the run is negative.  

So,  tan 135° = -1 



\begin{equation*}
\tan 135^\circ = \boxed{-1}
\end{equation*}

Okay, so we have a point in space, and it's described in two different ways.  One way is like using regular coordinates on a map (12, -4, 3), and the other way is like using angles to find the point (ρ, θ, φ).

We want to find cos φ.  Think of φ as the angle from the ground straight up to the point.  

We know the point is at (12, -4, 3), so it's 3 units up from the ground.  We also know ρ (rho) is 13.  

Remember, cos φ is like the "height" compared to the "hypotenuse" of a right triangle.  So:

cos φ = height / hypotenuse = 3 / 13



\begin{equation*}
