\end{equation*}

Okay, so we need to find the angle whose cosine is  -1/√2.  

Think of the unit circle.  The cosine of an angle is like how far right or left you are from the center of the circle.  

We know cos(π/4) is √2/2, which is positive. Since cosine is negative in the second and third quadrants, we need to look there.  

The angle in the second quadrant whose cosine is -1/√2 is 3π/4. 



\begin{equation*}
\arccos \left (-\frac{1}{\sqrt{2}} \right) = \boxed{\frac{3\pi}{4}}
\end{equation*}

Imagine a mirror reflecting a picture.  If you want to reflect a picture over a line, you need to figure out how that line acts like a mirror.

The vector $\begin{pmatrix} -1 \\ 3 \end{pmatrix}$ is like that line.  To find the "mirror" that reflects things over this line, we need a special kind of math tool called a matrix.

Think of a matrix like a set of instructions for how to change a picture.  The specific instructions for reflecting over our line are a bit complicated, but the result is this matrix:

\begin{equation*}
\boxed{\begin{pmatrix} 4/5 & 3/5 \\ 3/5 & 1/5 \end{pmatrix}}
\end{equation*}



This matrix will take any picture (represented as a set of numbers) and flip it over the line $\begin{pmatrix} -1 \\ 3 \end{pmatrix}$.
